import React, { useState } from 'react';
import 'bootstrap-icons/font/bootstrap-icons.css';

const TaskForm = () => {
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [dueDate, setDueDate] = useState('');
  const [priority, setPriority] = useState('medium');
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();

    const taskData = {
      title,
      description,
      due_date: dueDate,
      priority,
    };

    try {
      const response = await fetch('http://127.0.0.1:8000/api/tasks/tasks/#post-object-form', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(taskData),
      });

      if (!response.ok) {
        throw new Error('Failed to create task');
      }

      const newTask = await response.json();
      console.log('Task created:', newTask);

      setTitle('');
      setDescription('');
      setDueDate('');
      setPriority('medium');
      setError('');
    } catch (error) {
      setError('Error creating task: ' + error.message);
    }
  };

  return (
    <div className="max-w-2xl mx-auto p-8 bg-white rounded-lg shadow-lg transform hover:scale-105 transition-transform duration-200 ease-in-out">
      <div className="flex items-center space-x-3 mb-6">
        <i className="bi bi-plus-circle text-indigo-600 text-3xl"></i>
        <h2 className="text-2xl font-semibold text-gray-800">Create Task</h2>
      </div>

      <form onSubmit={handleSubmit} className="space-y-6">
        {/* Title Input */}
        <div>
          <label className="block text-gray-600 font-medium mb-1">Title</label>
          <input
            type="text"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
            placeholder="Task Title"
            className="w-full px-4 py-2 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-indigo-500 transition-transform duration-150 hover:bg-gray-50"
          />
        </div>

        {/* Description Input */}
        <div>
          <label className="block text-gray-600 font-medium mb-1">Description</label>
          <textarea
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            required
            placeholder="Task Description"
            className="w-full px-4 py-2 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-indigo-500 transition-transform duration-150 hover:bg-gray-50"
            rows="4"
          />
        </div>

        {/* Due Date Input */}
        <div>
          <label className="block text-gray-600 font-medium mb-1">Due Date</label>
          <input
            type="date"
            value={dueDate}
            onChange={(e) => setDueDate(e.target.value)}
            required
            className="w-full px-4 py-2 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-indigo-500 transition-transform duration-150 hover:bg-gray-50"
          />
        </div>

        {/* Priority Select */}
        <div>
          <label className="block text-gray-600 font-medium mb-1">Priority</label>
          <select
            value={priority}
            onChange={(e) => setPriority(e.target.value)}
            required
            className="w-full px-4 py-2 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-indigo-500 transition-transform duration-150 hover:bg-gray-50"
          >
            <option value="low">Low</option>
            <option value="medium">Medium</option>
            <option value="high">High</option>
          </select>
        </div>

        {/* Submit Button */}
        <button
          type="submit"
          className="w-full flex items-center justify-center bg-indigo-600 text-white py-3 rounded-lg shadow-md hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 transition-transform duration-200 hover:scale-105"
        >
          <i className="bi bi-check-circle mr-2"></i> Create Task
        </button>
      </form>

      {/* Error Message */}
      {error && <p className="mt-4 text-red-600 animate-pulse">{error}</p>}
    </div>
  );
};

export default TaskForm;
